const tickers = ["AAPL", "SQ", "FB", "AMD", "JPM"]
const basketTickers = [ AAPL, TSLA, FB, AMD, JPM ]

function randomticker() {
    return tickers.pop(tickers[Math.floor(Math.random() * tickers.length)]);
}

function random_bg_color() {
    var x = Math.floor(Math.random() * 256);
    var y = Math.floor(Math.random() * 256);
    var z = Math.floor(Math.random() * 256);
    var bgColor = "rgb(" + x + "," + y + "," + z + ")";
    return bgColor;
}
const closeV = VOO.data.map((cv) => cv.close).reverse()
const dates = VOO.data.map((p) => p.date.slice(0, 10)).reverse()
let ctx = document.getElementById('myChart')
let myChart = new Chart(ctx, {
    type: 'line',
    data: {
        labels: dates,
        datasets: [{
            label: VOO.meta.name,
            data: closeV,
            backgroundColor: color = random_bg_color(),
            borderColor: color,
        }]
    },
    options: {
        responsive: true,
        scales: {

        },
        plugins: {
            legend: {
                display: true
            }
        },
        transitions: {
            active: {
                animation: {
                    duration: 400
                }
            },
            show: {
                animations: {
                    
                    x: {
                        from: 0
                    },
                    y: {
                        from: 0
                    }
                }
            },
            hide: {
                animations: {
                    x: {
                        to: 0
                    },
                    y: {
                        to: 0
                    }
                }
            }
        }
    }
})

let oneMonth = document.getElementById("one-month")
oneMonth.onclick = function(myChart) {
        myChart.options = {
            responsive: true,
            scales: {
                x: { 
                    maxWidth: 5
                }
            }
        }
    };
    myChart.update();
document.body.appendChild(oneMonth);

let gen_egg = document.getElementById("gen_egg");
gen_egg.onclick = function () {
    let ticker = randomticker();
    fetch(`https://api.stockdata.org/v1/data/eod?symbols=${ticker}&api_token=xqBXpmR7pKuoaW8Dam5EVV3rJRovf8wUJoAzsCq8&date_from=2015`)
        .then(response => response.json())
        .then(data => graphdata(data));
// gen_egg.onclick = function () {
//         return graphdata(randomEgg())
}
document.body.appendChild(gen_egg);


let gen_basket = document.getElementById("gen_basket");
gen_basket.onclick = function () {
    return graphBasket(basketTickers);
};
document.body.appendChild(gen_basket);


function graphdata(obj) {
    // const closeValues = obj.data.map((p) => p.close).reverse()
    // const dates = obj.data.map((p) => p.date.slice(0,10)).reverse()

    
    
    
    let closeValues = obj.data.map((p) => p.close).reverse();
    myChart.data.datasets.push({
        label: obj.meta.name,
        data: closeValues,
        backgroundColor: color = random_bg_color(),
        borderColor: color,
        
    });
    myChart.options.plugins.legend.display = true;
    myChart.update();
}

function graphBasket(objarray) {
    for (let i = 0; i < objarray.length; i++){
    let obj = objarray[i];
    let closeValues = obj.data.map((p) => p.close).reverse()
    myChart.data.datasets.push({
        label: obj.meta.name,
        data: closeValues,
        backgroundColor: color = random_bg_color(),
        borderColor: color,
    })};
    myChart.options.plugins.legend.display = true;
    myChart.update();
}